// src/components/VideoTutorials.js
import React from 'react';
import './VideoTutorials.css';

const VideoTutorials = () => {
  const videos = [
    { title: "Introduction to Accessibility", url: "https://www.youtube.com/embed/3jZ5vnv-LZc" },
    { title: "Color Contrast Basics", url: "https://www.youtube.com/embed/S8G8cKJ4gE0" },
    { title: "Understanding ARIA Roles", url: "https://www.youtube.com/embed/zlX4C0R8P1A" },
    { title: "Keyboard Navigation Tips", url: "https://www.youtube.com/embed/N1gG0A_RgTE" },
    { title: "Screen Reader Basics", url: "https://www.youtube.com/embed/5s7uNw71Oz0" },
    { title: "Creating Accessible Forms", url: "https://www.youtube.com/embed/2m2TtC8xRk8" },
    { title: "Color Contrast Analyzer", url: "https://www.youtube.com/embed/5L2E9H6q5dY" },
    { title: "Accessible Images", url: "https://www.youtube.com/embed/3q8GQZb0KqU" },
    { title: "Testing for Accessibility", url: "https://www.youtube.com/embed/Hh1W8uNX5b4" },
    { title: "Building Accessible Navigation", url: "https://www.youtube.com/embed/8qU2s06gH4w" },
  ];

  return (
    <section>
      <h2>Video Tutorials</h2>
      <div className="video-grid">
        {videos.map((video, index) => (
          <div key={index} className="video-item">
            <h3>{video.title}</h3>
            <iframe
              width="100%"
              height="200"
              src={video.url}
              title={video.title}
              frameBorder="0"
              allowFullScreen
            ></iframe>
          </div>
        ))}
      </div>
    </section>
  );
};

export default VideoTutorials;
